'''Lobstrosities''' are giant lobsters located in the south-east corner of the [[Underwater]] area of [[Fossil Island]]. Most weapons and shields cannot be equipped in this area. Weapons that ''can'' be equipped and used to kill lobstrosities include the [[merfolk trident]], [[trident of the seas]]/[[Trident of the swamp|swamp]], [[brine sabre]], and [[magic secateurs]]. Lobstrosities may also be killed with magic.

A [[fishbowl helmet]] cannot be worn in this area, but players can easily use the nearby air bubbles to replenish oxygen while fighting lobstrosities.

[[Seaweed spore]]s will spawn around the area randomly. Though not confirmed, it appears that by re-entering the area by using the rift or underground tunnel after receiving three random seaweed spores spawns increases the amount of random seaweed spores that spawns afterwards.

